import {Route, Routes} from "react-router-dom";
import AllQuotes from "./pages/AllQuotes";
import QuoteDetail from "./pages/QuoteDetail";
import NewQuote from "./pages/NewQuote";

function App() {
    return (
        <div>
            <Routes>
                <Route to={'/quotes'} element={<AllQuotes/>}>All Quotes</Route>
                <Route to={'/quotes/:quoteId'} element={<QuoteDetail/>}>Quote Detail</Route>
                <Route to={'/new-quote'} element={<NewQuote/>}>New Quote</Route>
            </Routes>
        </div>
    );
}

export default App;
